import Vuex from 'vuex'

const pageOne = {
        namespaced: true,
    state: {
        data: { user: 'teste1' },
    },
}

const pageTwo = {
    state: () => ({
        user: 'Aqui a page2'
    })
}

export default new Vuex.Store({
    modules: {
        pageOne,
        pageTwo
    }
})
